import React, { useEffect, useCallback } from 'react';

import { EpubParser } from '@ridi/epub-parser';

// import Parser from '../../modules/Parser';

// import EPUB from '../../datum/epubs/pg61612.epub';


const Viewer = () => {
  const getParseEpub = useCallback((): Promise<null> => {
    const parser = new EpubParser('/pg61612.epub');
    // const test = new Parser(EPUB);
    // const res = await test.parse();

    // console.log(res);
    return null;
  }, []);

  useEffect(() => {
    getParseEpub();
  }, [getParseEpub]);


  return (
    <>
      Viewer Component
    </>
  );
};

export default Viewer;
